import React from 'react';
import { Redirect, withRouter } from "react-router-dom";

const Import = ({ history}) => {
    console.log(history)
    const clickHandler = () => {
        console.log('hej')
        return <Redirect to={'/graph'}/>
    }
    return(
        <button
            onClick={ () => clickHandler() }>
            Import
        </button>
    );
}

export default withRouter(Import);
